// import React from "./react"
import "./Logo.css";
import logo from "../../../static/logo.png";

function Logo(props) {
    return (
        <img id="logo_img" src={logo} alt="logo" width={props.width + "px"} height={props.width + "px"}/>
    )
}

export default Logo;
